import React, { useState } from 'react'
import NavBar from './NavBar'
import UserList from "./UserList"
import FriendRequests from './FriendRequests'
import FriendsList from './FriendList'
import { useEffect, setFReqs } from 'react'
import { useSelector } from 'react-redux'

export default function FriendsPage() {
  const [fReqs, setFReqs] = useState([])
  const thisId = useSelector((state) => state.user.userid)
  
  useEffect(() => {
    try {
      fetch("http://localhost:8080/fReq/get", {
        method: "GET",
        headers: {
          "Access-Control-Allow-Origin": true,
          "Content-Type": "application/json",
        }, 
      })
      .then((res) => {
        return res.json();
      })
      .then((res) => {
        setFReqs(res.freq)
      })
    } catch (err) {
      console.log(err)
    } 
    // eslint-disable-next-line react-hooks/exhaustive-deps
  },[])

  return (
    <div>
        <NavBar/>
        <div style={{display:"flex", width:"90vw", justifyContent:"space-evenly", padding:"50px"}}>
          <div>
              <UserList/>
          </div>
          <div>
              <FriendRequests fReq = {fReqs}/>
          </div>
          <div>
              <FriendsList/>
          </div>
        </div>
    </div>
  )
}
